import React from 'react';
import {range, Vec2} from '../utility';

type GridProps = {position: Vec2};

const Grid: React.FC<GridProps> = (props) => {
    return (
        <div>
            {range(0, 10).map((row) =>
                range(0, 10).map((col) => {
                    return (
                        <>
                            <div>
                                {row}, {col}
                            </div>
                            {row == 9 ? <br /> : null}
                        </>
                    );
                }),
            )}
        </div>
    );
};

export default Grid;
